                "codename": "Value from page",
                "packagename": "Page",
                "taxonomy": "data_dimension",
                "cost": 2,
                "sclosure": function(rule, args, state) {
                    var $els, jQ = rule.core.jQ;
                    function exec(type, name) {
                        var mapper = function($els, handler) {
                            return $els.map(handler).toArray();
                        };
                        switch (type) {
                        case 'selector':
                            switch ($els[0].tagName.toLowerCase()) {
                            case 'img':
                                return exec('attr', 'src');
                            case 'form':
                            case 'fieldset':
                                return exec('nodeHash');
                            case 'input':
                            case 'textarea':
                            case 'select':
                            case 'button':
                                return exec('nodeValue');
                            default:
                                return exec('nodeText');
                            }
                            break;
                        case 'attr':
                            return mapper($els, function() {
                                return jQ(this).attr(name);
                            });
                        case 'nodeText':
                            return mapper($els, function() {
                                return jQ(this).text();
                            });
                        case 'nodeHTML':
                            return mapper($els, function() {
                                return jQ(this).html();
                            });
                        case 'nodeHash':
                            return ElyTools.serializeForm($els[0]);
                        case 'nodeValue':
                        default:
                            return ElyTools.serializeInput($els[0]);
                        }
                    }
                    function oldExec(i, e) {
                        var value = ElyTools.serializeInput(e);
                        return value == null ? rule.core.jQ(this).text() : value;
                    }

                    switch (args.mode) {
                    case 'cookie':
                        return rule.core.cookie(args.selector);
                    case 'meta':
                        return rule.core.jQ("meta[name='" + args.selector + "']").attr('content');
                    case 'hidden':
                        return rule.core.jQ("input[type='hidden'][name='" + args.selector + "']").val();
                    case 'javascript':
                        for (var n = window, p = args.selector.split('.'), i = 0; p[i]; i++) {
                            n = n[p[i]];
                        }
                        return n;
                    case 'attr':
                    case 'nodeText':
                    case 'nodeValue':
                    case 'nodeHash':
                    case 'nodeHTML':
                    case 'selector':
                    default:
                        var ret;
                        $els = rule.core.jQ(args.selector);
                        if (args.mode != 'selector') {
                            ret = exec(args.mode, args.attr);
                        } else {
                            ret = [].slice.call($els.map(oldExec));
                            ret = ElyArray.filter(ret, function(i) {
                                return i != null;
                            });
                        }
                        if (ret.length == 1) {
                            ret = ret[0];
                        } else if (ret.length == 0) {
                            ret = '';
                        }
                        return ret;
                    }
                },
