                "sclosure": function(rule, args, state) {
                    var cookieContent = rule.getDataDimensionVal(args.valueid);
                    try {
                        eval('var cookieSettings =' + cookieContent);
                        if (typeof (cookieSettings) == 'object') {
                            var t = cookieSettings["LastModifiedDate"].replace("/Date(", "").replace(")/", "");
                            var epoch = 1438236000000;
                            if (cookieSettings.Allow == true && t >= epoch) {
                                return "accepted after 29 july";
                            } else if (cookieSettings.Allow == true && t < epoch) {
                                return "accepted";
                            } else {
                                for (i = 0; i < cookieSettings.CategoryPermission.length; i++) {
                                    var catName = cookieSettings.CategoryPermission[i]['Category'];
                                    if (catName == 'Cat.' + args.arg1949) {
                                        //It checks if the value equals true, if not it returns false
                                        if (t >= epoch) {
                                            return "not accepted after 29 july";
                                        } else {
                                            return "not accepted";
                                        }
                                    }
                                }
                                //PostNL cookie not allowed
                                if (t >= epoch) {
                                    return "not accepted after 29 july";
                                } else {
                                    return "not accepted";
                                }
                            }
                        } else {
                            //PostNL cookie malformed
                            return "unknown";
                        }
                    } catch (err) {
                        //PostNL cookie not set
                        return "cookie acceptance dialogue";
                    }
                },
